      case 'uint8_t':
        this.__array = Uint8Array
        break
      case 'signed char':
      case 'int8':
      case 'int8_t':
        this.__array = Int8Array
        break
      case 'short':
      case 'short int':
      case 'signed short':
      case 'signed short int':
